a:hover img {opacity: 0.7; filter: alpha(opacity=70); -moz-opacity: 0.7;} 
a:active {color:#333333;}
a{font-size:12px; text-decoration:none;}




/*関連リンク*/

div.kanren-link {color:#7f7f7f;width:90%;margin:20px auto;padding:20px;text-align: left;font-size:1.2em;background-color:#ffffff;border:solid 1px #f5f5d1;}
span.kanren-link {margin:10px ;padding: 0 0 0 0.5em;font-size:1.2em;
