}
a:link kanren-link{font-size:1.2em; color:#3380ff;text-decoration:none;}



/*買い物カゴボタン*/
#rakutenLimitedId_aroundCart input {
	width: 280px;
	height: 150px;
	background:url(http://image.rakuten.co.jp/velkommen/cabinet/bn/cart.gif) #ffffff no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent: 150%;
	white-space: nowrap;
	margin: 5px 0 0 0;
	display:block;
}

#rakutenLimitedId_aroundCart .inventory input {
	background:none !important;
	width: 2em!important;
	height: 1.2em!important;
	display:inline;
}


/*個数テキスト*/
#rakutenLimitedId_aroundCart .unit {
	font-size:16px;
}

/*個数入力*/
#rakutenLimitedId_aroundCart input#units {
	border:solid #ccc 1px;
	background:#fff!important;
	width:30px;
	height:30px;
	cursor:auto;
	padding:7px 7px 7px 3px;
	text-indent: 0px;
	overflow: hidden;
	display:inline;
	font-size:16px;
}

/*問合わせボタン*/
#rakutenLimitedId_aroundCart font input {
	width: 280px;
	height: 80px;
	background:url(http://image.rakuten.co.jp/velkommen/cabinet/bn/toi.gif) #ffffff no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent: 150%;
	white-space: nowrap;
	margin: 5px 0 0 0;
	display:block;
}

#serviceTableSml .favorite {
	display:block;
	width: 280px;
}

#serviceTableSml .favorite .bookmarkArea div{
	width: 280px!important;
}

#serviceTableSml .favorite .bkm a {
	width: 280px!important;
	height: 284px!important;
	background:url(http://image.rakuten.co.jp/velkommen/cabinet/bn/oki-1.gif) #ffffff no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent:-150%;
	margin: 5px 0 0 0;
	display:block;
}


/*お気に入り*/

div.w280-c  {width:280px;text-align: center;}
div.center-m-0a  {margin:0 auto;}
.item-oki-bn  {width:280px;margin:2px 0;border:none;}
.item-iframe  {margin:0px;border:0px;}

